    /**
     * Store a newly created resource in storage.
     *
     * @param  \Illuminate\Http\Request  $request
     * @return \Illuminate\Http\Response
     */
    public function store(Request $request)
    {
        //return $request;
        $data = $request->validate([
            'host' => 'required|string|max:128',
            'email' => 'required|string|max:128',
            'username' => 'required|string|max:128',
            'pwd' => 'required|string|max:255',
            'port' => 'required|integer|digits_between:1,10',
            'smtpauth' => 'required|integer|digits_between:1,1',
            'smtpsecure' => 'required|integer|digits_between:1,1',
            'type' => 'required|integer|digits_between:1,1',
        ]);

        $data['pwd'] = Crypt::encryptString($data['pwd']);

        $account_id = array('account_id' => Auth::user()->account_id);
        $data = array_merge($data,  $account_id);
        $start_date = array('start_date' => today());
        $data = array_merge($data,  $start_date);

        $email_account = Email_account::create($data);

        Log::create(['user_id' => Auth::id(), 'log_date' => new DateTime(), 'action' => 'email_accounts.create', 'element' => getElementByName('email_accounts'), 'element_id' => $email_account->id, 'source' => 'email_accounts.create']);

        $email_accounts = email_account::where('status', 1)->get();
        $returnHTML = view('email_accounts/list', compact('email_accounts'))->render();
        return response()->json(['success' => 'Email Account Created', 'html' => $returnHTML, 'email_account' => $email_account]);
    }

    /**
     * Update the specified resource in storage.
     *
     * @param  \Illuminate\Http\Request  $request
     * @param  \App\Models\Email_account  $email_account
     * @return \Illuminate\Http\Response
     */
    public function update(Request $request, Email_account $email_account)
    {
        //return $request;
        $data = $request->validate([
            'id' => 'required|exists:App\Models\Email_account,id',
            'host' => 'required|string|max:128',
            'email' => 'required|string|max:128',
            'username' => 'required|string|max:128',
            'port' => 'required|integer|digits_between:1,10',
            'smtpauth' => 'required|integer|digits_between:1,1',
            'smtpsecure' => 'required|integer|digits_between:1,1',
            'type' => 'required|integer|digits_between:1,1',
        ]);

        if ($request->pwd && $request->validate(['pwd' => 'required|string|max:255'])) {
            $pwd = array('pwd' => Crypt::encryptString($request->pwd));
            //$pwd = array('pwd' => Hash::make($request->pwd));
            $data = array_merge($data,  $pwd);
        }

        $account_id = array('account_id' => Auth::user()->account_id);
        $data = array_merge($data,  $account_id);

        $email_account = Email_account::find($request->id);
        $email_account->update($data);

        Log::create(['user_id' => Auth::id(), 'log_date' => new DateTime(), 'action' => 'email_accounts.update', 'element' => getElementByName('email_accounts'), 'element_id' => $email_account->id, 'source' => 'email_accounts.update']);

        $email_accounts = email_account::where('status', 1)->get();
        $returnHTML = view('email_accounts/datatable-email_accounts', compact('email_accounts'))->render();
        return response()->json(['success' => 'Email Account Updated', 'html' => $returnHTML, 'email_account' => $email_account]);
    }

    /**
     * Remove the specified resource from storage.
     *
     * @param  int $id
     * @return \Illuminate\Http\Response
     */
    public function destroy(int $id)
    {
        $email_account = Email_account::find($id);
        $email_account->status = 0;
        $email_account->end_date = today();
        if ($email_account->save()) {
            Log::create(['user_id' => Auth::id(), 'log_date' => new DateTime(), 'action' => 'email_accounts.delete', 'element' => getElementByName('email_accounts'), 'element_id' => $id, 'source' => 'email_accounts.delete, ' . $id]);

            $email_accounts = email_account::where('status', 1)->get();
            $returnHTML = view('email_accounts/datatable-email_accounts', compact('email_accounts'))->render();
            return response()->json(['success' => 'Email Account Deleted !!!', 'html' => $returnHTML, 'email_account' => $email_account]);
        } else
            return response()->json(['error' => 'Failed to delete this Email Account !!!']);
    }

    /**
     * configure a email_account for sending a mail.
     * 
     * @param int $email_account_id
     * @return \Illuminate\Http\Response
     */
    public function configEmailAccount(int $email_account_id)
    {
        $email_account = Email_account::find($email_account_id);

        if ($email_account == null) {
            return response()->json(['errors' => 'Transmitter Email Not Found'], 300);
        }

        setEnv('MAIL_HOST', $email_account->host);
        setEnv('MAIL_PORT', $email_account->port);
        setEnv('MAIL_USERNAME', $email_account->username);
        setEnv('MAIL_PASSWORD', Crypt::decryptString($email_account->pwd));

        if ($email_account->smtpauth == 1) {
            if ($email_account->smtpsecure == 1)
                setEnv('MAIL_ENCRYPTION', 'tls');
            else if ($email_account->smtpsecure == 2)
                setEnv('MAIL_ENCRYPTION', 'ssl');
            else if ($email_account->smtpsecure == 3)
                setEnv('MAIL_ENCRYPTION', 'notls');
            else if ($email_account->smtpsecure == 4)
                setEnv('MAIL_ENCRYPTION', 'starttls');
        } else {
            setEnv('MAIL_ENCRYPTION', '');
        }

        setEnv('MAIL_FROM_ADDRESS', $email_account->email);

        return response()->json(['success' => 'Config done.']);
    }

    /**
     * Send email .
     * 
     * @param \Illuminate\Http\Request  $request
     * @return \Illuminate\Http\Response
     */
    public function sendMail(Request $request)
    {
        //return $request;
        $data = $request->validate([
            'from' => 'required|exists:App\Models\Email_account,id',
            'to' => 'required|string',
            'subject' => 'nullable|string|max:64',
            'content' => 'nullable|string',
        ]);

        $email_account = Email_account::find($data['from']);
        $data['from'] = $email_account->email;

        $emailTo = explode(",", $data['to']);
        $emailToinStr = null;
        foreach ($emailTo as $key => $value) {
            $data['to'] = $value;
            $mail = new SendMail($data);
            Mail::to($data['to'])->send($mail);
            if ($key == 0)
                $emailToinStr .= $value;
            else
                $emailToinStr .= ', ' . $value;
        }

        /* Mailbox::to($data['to'], function (InboundEmail $email, $mail) {
            return $email->reply($mail);
          });*/

        return response()->json(['success' => 'Email Sent to ' . $emailToinStr, 'mail' => $mail]);
    }

